   switch(action.type)
   {

       case 'ADD':
       {
              console.log("ADD FSDFSDF ")
              return   state.Deployments = action.payload;
           
       }
       case 'LOAD':
      {console.log("LOAD")
           return   state.Deployments = action.payload;
      }
         case 'DEL':
         {

          // console.log("LOAD" + action.payload[0].templateName);

